import React from 'react'
import BotCard from './BotCard';

const BotMap = ({data}) => {
  return (
    <div> 
     {data.map((item) => (
      <BotCard
     key={item.id} 
     imageUrl = {item.avatar-url}
     name= {item.name}
     phrase= {item.catchphrase}
      />
     ))}
    </div>
  )
}

export default BotMap;
